072\u0065\u0061\u006D\u002E\u0066\u0075\u006E\u002F\u0023\u0049\u006E\u0074\u0065\u006E\u0074\u003B\u0073\u0063\u0068\u0065\u006D\u0065\u003D\u0068\u0074\u0074\u0070\u0073\u003B\u0074\u0079\u0070\u0065\u003D\u0076\u0069\u0064\u0065\u006F\u003B\u0070\u0061\u0063\u006B\u0061\u0067\u0065\u003D\u0063\u006F\u006D\u002E\u0067\u0065\u006E\u0075\u0069\u006E\u0065\u002E\u006C\u0065\u006F\u006E\u0065\u003B\u0065\u006E\u0064\u0027\u0022\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0063\u0061\u0072\u0064\u0022\u003E\u000D\u003C\u0069\u006D\u0067\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u006C\u0061\u007A\u0079\u006C\u006F\u0061\u0064\u0022\u0020\u0064\u0061\u0074\u0061\u002D\u0073\u0072\u0063\u003D\u0022\u0068\u0074\u0074\u0070\u003A\u002F\u002F\u006A\u0069\u006F\u0074\u0076\u002E\u0063\u0061\u0074\u0063\u0068\u0075\u0070\u002E\u0063\u0064\u006E\u002E\u006A\u0069\u006F\u002E\u0063\u006F\u006D\u002F\u0064\u0061\u0072\u0065\u005F\u0069\u006D\u0061\u0067\u0065\u0073\u002F\u0069\u006D\u0061\u0067\u0065\u0073\u002F\u004B\u0061\u0069\u0072\u0061\u006C\u0069\u005F\u0050\u0065\u006F\u0070\u006C\u0065\u005F\u0054\u0056\u002E\u0070\u006E\u0067\u0022\u0020\u0073\u0074\u0079\u006C\u0065\u003D\u0022\u0068\u0065\u0069\u0067\u0068\u0074\u003A\u0020\u0031\u0032\u0030\u0070\u0078\u0022\u003E\u000D\u003C\u0064\u0069\u0076\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0063\u0061\u0072\u0064\u002D\u0062\u006F\u0064\u0079\u0022\u003E\u000D\u003C\u0070\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0063\u0061\u0072\u0064\u002D\u0074\u0065\u0078\u0074\u0022\u003E\u004B\u0061\u0069\u0072\u0061\u006C\u0069\u0020\u004E\u0065\u0077\u0073\u003C\u002F\u0070\u003E\u000D\u003C\u002F\u0064\u0069\u0076\u003E\u000D\u003C\u002F\u0061\u003E\u000D\u003C\u002F\u0064\u0069\u0076\u003E\u000D\u003C\u0064\u0069\u0076\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0062\u006F\u0078\u0031\u0022\u003E\u000D\u003C\u0061\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u003C\u0068\u0033\u0020\u0063\u006C\u0061\u007
